import './App.css';

function App() {
  return (
    <div className="App">
       <form className={classes.form} noValidate onSubmit={handleSubmit}>
            <TextField variant="outlined" margin="normal" required fullWidth id="email" name="email" label="Email Address" onChange={e => setUserName(e.target.value)} />
            <Button type="submit" fullWidth variant="contained" color="primary" className={classes.submit} >
              Sign In
            </Button>
          </form>
    </div>
  );
}

export default App;
